import {useState, useEffect} from "react";
import axios from "axios";

export const Bookindex = () => {
  const [books, setBooks] = useState([]);

  useEffect(() => {
    const getBooks = async () => {
    const apiBooks = await axios.get("http://localhost:8000/api/v1/books");
    setBooks(apiBooks.data.data);
  };
  getBooks();
  }, []);
 
  return (
    <div className="mt-12">
      <div class="relative overflow-x-auto">
        <table class="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400">
          <thead class="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
            <tr>
              <th scope="col" class="px-6 py-3">
                Title
              </th>
              <th scope="col" class="px-6 py-3">
                Author
              </th>
              <th scope="col" class="px-6 py-3">
                Publication Year
              </th>
              <th scope="col" class="px-6 py-3">
                ISBN
              </th>
              <th scope="col" class="px-6 py-3">
                Nr. in Stock
              </th>
            </tr>
          </thead>
          <tbody>
           {books.map((book)=>{
            return(
            <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
              <td class="px-6 py-4">{book.title}</td>
              <td class="px-6 py-4">{book.author}</td>
              <td class="px-6 py-4">{book.publication_year}</td>
              <td class="px-6 py-4">{book.ISBN}</td>
              <td class="px-6 py-4">{book.no_in_stock}</td>
            </tr>
            );
           })}
          </tbody>
        </table>
      </div>
    </div>
  );
};
